import React, { Component } from 'react';

class CompleteButton extends Component {
  render() {
    return (
      <>
        <span className="text-4xl">&#x2192;</span>
        <button id="complete-button" className="static-button">Complete</button>
      </>
    );
  }
}

export default CompleteButton;
